import { Component, OnInit } from '@angular/core';
import { AngularFirestore } from '@angular/fire/compat/firestore';
import { getMedicamentByName } from 'src/firebaseConfig';


interface MedicamentDD {
  class: string;
  conditionnement: string;
  conservation: string;
  amm: string;
  dateamm: string;
  dci: string;
  dosage: string;
  forme: string;
  indication: string;
  laboratoire: string;
  sousclass: string;
  specialite: string;
  specification: string;
  tableau: string;
}

@Component({
  selector: 'app-recherche-medicament',
  templateUrl: './recherche-medicament.page.html',
  styleUrls: ['./recherche-medicament.page.scss'],
})
export class RechercheMedicamentPage implements OnInit {



  medicament: MedicamentDD[] = [];
  nom: string = '';

  constructor(private firestore: AngularFirestore) { }

  ngOnInit() {
  }

  async fetchMedicament() {
    const medicament = await getMedicamentByName(this.firestore, this.nom);
    console.log('Médicament récupéré:', medicament);
    // Faites ici ce que vous voulez avec le médicament récupéré
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>

    <ion-button routerLink="/tabs/tab3" fill="clear"> Retour</ion-button>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-grid>
    <ion-row>
      <ion-col>
  <ion-item class="entier">
    <ion-icon name="search-outline" class="warning"></ion-icon>
    <ion-input placeholder="&nbsp;Nom" type="text" name="nom" [(ngModel)]="nom" >

    </ion-input>
  </ion-item>
</ion-col>

  <ion-col size="auto">
    <ion-button (click)="fetchMedicament()"> 
      <ion-icon name="search-outline"></ion-icon>
    </ion-button>
  </ion-col>
</ion-row>
</ion-grid>

<div *ngIf="medicament">
  <h2>Détails du médicament</h2>
  <p *ngFor="let med of medicament"> <!-- Itération sur le tableau medicament -->
    <strong>Class:</strong> {{ medicament.class }}</p> <!-- Accès aux propriétés de chaque élément du tableau -->
  <p><strong>Conditionnement:</strong> {{ medicament.conditionnement }}</p>
  <p><strong>Conservation:</strong> {{ medicament.conservation }}</p>
  <p><strong>AMM:</strong> {{ medicament.amm }}</p>
  <p><strong>Date AMM:</strong> {{ medicament.dateamm }}</p>
  <p><strong>DCI:</strong> {{ medicament.dci }}</p>
  <p><strong>Dosage:</strong> {{ medicament.dosage }}</p>
  <p><strong>Forme:</strong> {{ medicament.forme }}</p>
  <p><strong>Indication:</strong> {{ medicament.indication }}</p>
  <p><strong>Laboratoire:</strong> {{ medicament.laboratoire }}</p>
  <p><strong>Sous-class:</strong> {{ medicament.sousclass }}</p> <!-- Correction du nom de la propriété -->
  <p><strong>Spécialité:</strong> {{ medicament.specialite }}</p>
  <p><strong>Spécification:</strong> {{ medicament.specification }}</p>
  <p><strong>Tableau:</strong> {{ medicament.tableau }}</p>
</div>

</ion-content>
